function Menu() {
  return (
    <div className="menu">
      <ul>
        <li>
          <a href="#">Главаная</a>
        </li>
        <li>
          <a href="#">О нас</a>
        </li>
        <li>
          <a href="#">Контакты</a>
        </li>
      </ul>
    </div>
  );
}
export default Menu;
